       <a href="https://www.tripadvisor.in/Restaurant_Review-g297628-d7925189-Reviews-By_2_Coffee-Bengaluru_Bangalore_District_Karnataka.html" target="_blank"><img className="food-img" src="https://images.alphacoders.com/862/thumb-1920-862639.jpg" alt="Dosa"></img></a>
